import { Grid, Container, Box, useMediaQuery } from '@mui/material';
import payment from '../src/payment.svg';

function Price() {
  const isSmallScreen = useMediaQuery('(max-width:2000px)'); // Define your breakpoint here

  return (
    <Container
      maxWidth="xl"
      id = "price"
      style={{
        background: '#F2E7D6',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        position: "relative"
        // minHeight: '100vh',
      }}
    >
      <Grid
        container
        spacing={isSmallScreen ? 2 : 10}
        alignContent="flex-start"
        alignItems="center"
        justifyContent="center"
      >
        <Grid item xs={12} sm={6}>
          <Box p={0}>
            <img
              className="my-svg"
              src={payment}
              height="auto"
              width="100%"
            />
          </Box>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Box
            p={0}
            alignItems="left"
            style={{
              background: '#CCA06F',
              padding: isSmallScreen ? '2%' : '4%', // Adjust padding for smaller screens
              borderRadius: '20px',
            }}
          >
            <h1
              style={{
                fontFamily: 'yeseva one',
                fontSize: isSmallScreen ? 20 : 24, // Adjust font size for smaller screens
                color: 'white',
              }}
            >
              $45/hr
            </h1>
            <p
              style={{
                fontFamily: 'josefin sans',
                fontSize: isSmallScreen ? 18 : 25, // Adjust font size for smaller screens
                color: 'white',
              }}
            >
              *Starting rate. Rate is dependent on project, timeline, and
              requirements.
            </p>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Price;
